// src/components/Navigation.js
import React from 'react';

const Navigation = ({ onChange }) => {
  return (
    <nav>
      <ul>
        <li>
          <button onClick={() => onChange('login')}>Login</button>
        </li>
        <li>
          <button onClick={() => onChange('signup')}>Signup</button>
        </li>
      </ul>
    </nav>
  );
};

export default Navigation;
